import React from "react";
import cartLogo from '../assets/navbar/cart.svg';
import searchLogo from '../assets/navbar/search.svg';
import userLogo from '../assets/navbar/user.svg';
import sidebarBtn from '../assets/navbar/sidebar_btn.svg';


const Navbar = () => {
    return (
        <>
            <nav className="navbar navbar-dark bg-dark">
                <button className="btn">
                    <i className="bi bi-list" style={{"color": "white", "font-size": 24}} />
                </button>

            </nav>
        </>
    )
}

export default Navbar;
